import React from 'react';
import about from './images/about';
import documents from './images/documents';
import pictures from './images/pictures';
import soon from './images/soon';





const Rightfinderhome = () => {
    return(
             <div className='rightFinderhome'>
                <div className='about'>
                    <img src={about} alt=''></img>
                    <div>About.doc</div>
                </div>
                <div className='documents'>
                    <img src={documents} alt=''></img>
                    <div>Documents</div>
                </div>
                <div className='pictures'>
                    <img src={pictures} alt=''></img>
                    <div>Pictures.png</div>
                </div>
                <div className='soon'>
                    <img src={soon} alt=''></img>
                    <div>Soon.doc</div>
                </div>
            </div>

    )
}

export default Rightfinderhome;
